import React from 'react';

interface DayData {
  steps: string;
  stride: string;
  calories: string;
  water: string;
  workout: string;
  height: string;
  weight: string;
  heartRate: string;
  sleep: string;
  bmi: string;
  distance: string;
}

const StoredData: React.FC<{ days: DayData[] }> = ({ days }) => (
  <div style={{ margin: '2rem' }}>
    <h2>Stored Days</h2>
    {days.length === 0 && <p>No data stored yet.</p>}
    {days.map((day, idx) => (
      <div key={idx} style={{ marginBottom: '1.5rem', padding: '1rem', background: '#f9f9f9', borderRadius: '8px' }}>
        <h4>Day {idx + 1}</h4>
        <p>Steps: {day.steps || 0}</p>
        <p>Stride Length: {day.stride || 0} cm</p>
        <p>Calories: {day.calories || 0}</p>
        <p>Water Intake: {day.water || 0} L</p>
        <p>Workout Time: {day.workout || 0} min</p>
        <p>Weight: {day.weight || 0} kg</p>
        <p>Height: {day.height || 0} cm</p>
        <p>BMI: {day.bmi || 0}</p>
        <p>Distance: {day.distance || 0} km</p>
        <p>Heart Rate: {day.heartRate || 0} bpm</p>
        <p>Sleep Hours: {day.sleep || 0}</p>
      </div>
    ))}
  </div>
);

export default StoredData;
